package com.fss.card.test;

import java.util.HexFormat;
import org.util.iso8583.EncoderDecoder;
import org.util.iso8583.ISO8583Loggging;
import org.util.iso8583.ISO8583Message;

import com.fss.card.acquirer.format.TangoFormat;

public class TestNew {

	public static void main(String[] args) {
		EncoderDecoder.log = true;
		byte[] message = HexFormat.of().parseHex(
				"");
		ISO8583Message iso8583Message = EncoderDecoder.decode(TangoFormat.getInstance(), message);
		System.out.println(ISO8583Loggging.log(iso8583Message));
	}
}
